import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on profile link using text content
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile page to load
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information using multiple selector strategies
    const profileData = await page.evaluate(() => {
      // Try to get data from JavaScript object first
      if (window.junProfile) {
        return window.junProfile;
      }

      // Fallback to DOM extraction if JavaScript object not available
      return {
        username: document.querySelector('.username')?.textContent || 'N/A',
        fullName: document.querySelector('.profile-info h2')?.textContent || 'N/A',
        email: 'N/A', // Not visible in DOM
        joinDate: 'N/A', // Not visible in DOM
        totalOrders: document.querySelector('.stat:first-child .stat-number')?.textContent || 'N/A',
        totalReviews: document.querySelector('.stat:nth-child(2) .stat-number')?.textContent || 'N/A',
        sellerRating: document.querySelector('.stat:last-child .stat-number')?.textContent || 'N/A',
        bio: document.querySelector('.bio')?.textContent || 'N/A'
      };
    });

    // Take final screenshot with profile data visible
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Harvested user profile information by navigating to profile page and extracting data",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
